import React from 'react';

let Users = (props) => {
    return <div>
        {
            props.users.map(u=> <div>
                <span>
                    <div>
                        <img />
                    </div>
                </span>
                <span>
                    <button>follow</button>
                </span>
            </div>
                )
        }
    </div>
}
export default Users;
